import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function Books() {
  return <div>Bücher Liste</div>;
}

function GenreBooks() {
  return <div>Bücher nach Genre</div>;
}

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/books" component={Books} />
        <Route path="/books/:genre" component={GenreBooks} />
        <Route path="*">
          <div>Seite nicht gefunden</div>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
